import reset from '../images/reset.png';
function Reset(props) {
  return (
    <section>
      <button
        type='reset'
        className='resetButton'
        onClick={props.handleResetButton}
      >
        <img src={reset} alt='Reset'></img>
      </button>
    </section>
  );
}
export default Reset;
